// 페이지 공통부분 처리
import PropTypes from 'prop-types';
import 'antd/dist/antd.css'
import Head from 'next/head'
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

const App = ({ Component }) => {
    return (
        <>
        <Head>
            <meta charSet="utf-8"/>
            <title>Bluedot</title>
        </Head>
        <Router>
            <Component />
        </Router>

        </>
    )
};

App.propTypes = {
    Component: PropTypes.elementType.isRequired,
}

export default App;
